export var obj = JSON.parse(localStorage.getItem('user')) || '';
export let firstName = (localStorage.getItem('user') !== null) ? obj[0].firstName : '';
export let lastName = (localStorage.getItem('user') !== null) ? obj[0].lastName : '';
export let email = (localStorage.getItem('user') !== null) ? obj[0].email : '';

export let letter = firstName.charAt(0).toUpperCase();

export let URL = "http://localhost:5000/users?email=" + email;

export const LargeProfileIcon = ({ letter }) => {
  <div className="user-icon-2">
    {letter}
  </div>
}

export const ProfileIcon = ({ letter }) => {
  <div className="user-icon-1">
    {letter}
  </div>
}
